import React from "react";
const Data = (props) =>{
    return(
        <ul>
        <li>
            <h2>{props.result[0].from}</h2>
            <h2>{props.result[0].to}</h2>
        </li>
        <li>
            <h2>{props.result[1].from}</h2>
            <h2>{props.result[1].to}</h2>
        </li>
        </ul>
    )
}
export default Data;
